const QueryContext = createContext();

const intialState = {
  allProduct: [],
  allCourseInProduct: [],
  selectedProduct: {
    AssignmentID: null,
    AssignmentName: null,
  },
  selectedCourse: [],
  stats: {},
};

function reducer(state, action) {
  switch (action.type) {
    case "loadAllProducts":
      const tempProd = SimulationCohortSummaries.reduce((acc, curr) => {
        const index = acc.findIndex(
          (obj) => obj.AssignmentID === curr.AssignmentID
        );
        if (index === -1) {
          acc.push({
            AssignmentID: curr.AssignmentID,
            AssignmentName: curr.AssignmentName,
          });
        }
        return acc;
      }, []);
      return { ...state, allProduct: tempProd };
    case "productSelected":
      const tempCourse = SimulationCohortSummaries.filter(
        (obj) => obj.AssignmentID === action.payload.AssignmentID
      ).map((obj) => {
        return {
          CohortID: obj.CohortID,
          CohortName: obj.CohortName,
          StudentCount: obj.StudentCount,
        };
      });
      return {
        ...state,
        selectedProduct: action.payload,
        allCourseInProduct: tempCourse,
      };
    case "courseSelected":
      let updatedSelectedCourse = [];
      if (state.selectedCourse.includes(action.payload)) {
        updatedSelectedCourse = state.selectedCourse.filter(
          (id) => id != action.payload
        );
      } else {
        updatedSelectedCourse = [...state.selectedCourse, action.payload];
      }
      return {
        ...state,
        selectedCourse: updatedSelectedCourse,
      };
    case "generateStats":
      return { ...state, stats: action.payload };
    default:
      throw new Error("Action Unknown");
  }
}

function QueryContextProvider({ children }) {
  const [
    { allProduct, allCourseInProduct, selectedProduct, selectedCourse, stats },
    dispatch,
  ] = useReducer(reducer, intialState);

  function handleSelectProduct(e) {
    const AssignmentID = Number(e.target.value.split("|").at(0));
    const AssignmentName = e.target.value.split("|").at(1);

    dispatch({
      type: "productSelected",
      payload: { AssignmentID, AssignmentName },
    });
  }

  function handleSelectCourse(e) {
    dispatch({
      type: "courseSelected",
      payload: Number(e.target.id),
    });
  }

  function handleGenerateStats() {
    if (selectedProduct.AssignmentID === null) return;
    dispatch({
      type: "generateStats",
      payload: generateStats(selectedProduct, selectedCourse),
    });
  }

  useEffect(function () {
    dispatch({ type: "loadAllProducts" });
  }, []);

  return (
    <QueryContext.Provider
      value={{
        allProduct,
        allCourseInProduct,
        selectedProduct,
        stats,
        handleSelectProduct,
        handleSelectCourse,
        handleGenerateStats,
      }}
    >
      {children}
    </QueryContext.Provider>
  );
}

function useQuery() {
  const context = useContext(QueryContext);
  if (context === undefined)
    throw new Error("QueryContext was used outside of QueryContextProvider");
  return context;
}

export { QueryContextProvider, useQuery };
